import React, { useState } from "react";
import "./auth.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Register from "./register";
import Footer from "./footer";
import Head from "./header";

function Signin() {
  function redToRegister() {
    window.location.href = "/register";
  }
  return (
    <div>
      <Head/>
      <div className="page">
        <div className="cardBody login">
          <div className="hi">
            <p className="hi1">Hi Welcome back!</p>
            {/* <p className="hi1">Want to join our commnuity?</p> */}
          </div>

          <div className="inputBox">
            <input type="text" className="input" placeholder="Email" />
          </div>

          <div className="inputBox">
            <input type="text" className="input" placeholder="Password" />
          </div>

          <div className="below">
            <div className="submitBox">
              <button className="signUpBtn">SIGNIN HERE</button>
            </div>

            <div className="or">
              <hr className="hr" />
              OR
              <hr className="hr" />
            </div>
            <div className="submitBox">
              <button onClick={redToRegister} className="signUpBtn">
                REGISTER
              </button>
            </div>
          </div>
        </div>
      </div>
      <Footer/>
    </div>
  );
}

export default Signin;
